    false,nt"url": null,nt"notes": "NCEI Accession 0134539 includes physical
    and profile data collected aboard the ROGER REVELLE during cruise RR1307 in the
    Philippine Sea and South China Sea (Nan Hai) from 2013-05-30 to 2013-06-09. These
    data include CONDUCTIVITY, SALINITY and WATER TEMPERATURE. The instruments used
    to collect these data include CTD. These data were collected by Thomas Sanford of
    University of Washington; Applied Physics Laboratory, and by University of California
    - San Diego; Scripps Institution of Oceanography as part of Origins of the Kuroshio
    and Mindanao Currents (OKMC) Moorings. The Lamont-Doherty Earth Observatory (LDEO)
    submitted these data to NCEI as part of the NSF sponsored Rolling Deck to Repository
